// IMPORT REACT
import React from 'react'

// IMPORT REACT DOM
import {Switch, Route} from 'react-router-dom'

// import estilo
import './Content.css'

// importe componentes
import About from '../../views/example/About'

const Content = props => (
    <main className="Content">
        <Switch>
            <Route path="/about">
                <About />
            </Route>
        </Switch>
    </main>
)

export default Content
